#include <bits/stdc++.h>
using namespace std;
typedef long long ll;
typedef vector <int> vi;

vi a(8);
int min1, counter, i, j;
string line = "";
int main(){
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    freopen("in.txt", "r", stdin);
    freopen("out.txt", "w", stdout);
    int cas = 1;
    while(cin.peek() != EOF){
    	cout << "Case " << cas << ": ";
    	min1 = INT_MAX;
    	for(i=0; i<8; i++) cin >> a[i]; cin.ignore(); cin.ignore();
    	for(i=0; i<92; i++){
    		counter = 0;
    		for(int j=0; j<8; j++){
    			if(line[i*8+j] - '0' != a[j]) counter++;
    		}
    		if(counter < min1) min1 = counter;
    	}
    	cout << min1 << "\n";
    	cas++;
    }
    return 0;
}